class Vertex:
    def __init__(self, name):
        self.name = name
        self.neighbors = []

    def add_neighbor(self, neighbor):
        if neighbor not in self.neighbors:
            self.neighbors.append(neighbor)

class DistributedNetwork:
    def __init__(self):
        self.vertices = {}

    def add_vertex(self, vertex_name):
        if vertex_name not in self.vertices:
            self.vertices[vertex_name] = Vertex(vertex_name)

    def add_edge(self, v1, v2):
        if v1 in self.vertices and v2 in self.vertices:
            self.vertices[v1].add_neighbor(v2)
            self.vertices[v2].add_neighbor(v1)
        else:
            print("One or both vertices not found in the network.")

    def print_network(self):
        for vertex_name, vertex in self.vertices.items():
            print(f"Vertex {vertex_name} neighbors: {vertex.neighbors}")


# Example usage:
network = DistributedNetwork()

# Add vertices
network.add_vertex("A")
network.add_vertex("B")
network.add_vertex("C")
network.add_vertex("D")

# Add edges
network.add_edge("A", "B")
network.add_edge("B", "C")
network.add_edge("C", "D")
network.add_edge("D", "A")

# Print the network
network.print_network()

