class CliqueNetwork(DistributedNetwork):
    def __init__(self):
        super().__init__()
        self.cliques = []

    def bron_kerbosch(self, R, P, X):
        if len(P) == 0 and len(X) == 0:
            self.cliques.append(R)
            return

        for v in list(P):
            self.bron_kerbosch(
                R.union({v}),
                P.intersection(self.vertices[v].neighbors),
                X.intersection(self.vertices[v].neighbors),
            )
            P.remove(v)
            X.add(v)

    def find_all_cliques(self):
        self.cliques = []
        self.bron_kerbosch(set(), set(self.vertices.keys()), set())

    def print_all_cliques(self):
        print("All Cliques:")
        for clique in self.cliques:
            print(clique)


