import networkx as nx
import random
import threading

class LubyMIS:
    def __init__(self, graph):
        self.graph = graph
        self.nodes = list(graph.nodes())
        self.independent_set = set()
        self.lock = threading.Lock()

    def is_independent_set(self, node):
        for neighbor in self.graph.neighbors(node):
            if neighbor in self.independent_set:
                return False
        return True

    def add_to_independent_set(self, node):
        with self.lock:
            self.independent_set.add(node)

    def run(self):
        while True:
            previous_independent_set_size = len(self.independent_set)
            v = random.choice(self.nodes)
            print("Selected node:", v)
            if self.is_independent_set(v):
                self.add_to_independent_set(v)
                print("Adding", v, "to the independent set")
                for neighbor in list(self.graph.neighbors(v)):  # Convert to list to avoid iteration issues
                    if neighbor in self.nodes:  # Check if the neighbor is still in the list
                        self.nodes.remove(neighbor)
                print("Remaining nodes:", self.nodes)
            print("Independent set:", self.independent_set)
            if len(self.independent_set) == previous_independent_set_size:
                break

if __name__ == "__main__":
    # Example usage
    # Create a random graph
    num_nodes = 10
    probability = 0.3
    random_graph = nx.erdos_renyi_graph(num_nodes, probability)

    # Initialize Luby's MIS algorithm with the graph
    luby_mis = LubyMIS(random_graph)

    # Run the algorithm
    luby_mis.run()

    # Print the independent set found
    print("Maximal Independent Set:", luby_mis.independent_set)

