class Process:
    def __init__(self, uid, neighbors):
        self.uid = uid
        self.neighbors = neighbors
        self.depth = float('inf')
        self.parent = None
        self.messages_received = 0
        self.converged = False  # Flag to indicate convergence

    def send_message(self):
        return self.depth + 1, self.converged

    def receive_message(self, message, sender_uid):
        new_depth, converged = message
        if new_depth < self.depth:
            self.depth = new_depth
            self.parent = sender_uid
            self.messages_received += 1
            if self.converged != converged:
                self.converged = converged
                return True
        return False

def bfs_spanning_tree(root_uid, processes):
    root_process = processes[root_uid]
    root_process.depth = 0
    root_process.parent = root_uid
    current_round = 0
    while True:
        current_round += 1
        messages_sent = 0
        converged_flag = True  # Assume convergence until proven otherwise
        for uid, process in processes.items():
            for neighbor_uid in process.neighbors:
                neighbor_process = processes[neighbor_uid]
                message = process.send_message()
                messages_sent += 1
                received = neighbor_process.receive_message(message, uid)
                if received:
                    print(f"Round {current_round}: Process {neighbor_uid} updated its depth to {neighbor_process.depth} with parent {uid}")
                    converged_flag = False  # If any process updates its depth, convergence is not achieved
        if messages_sent == 0 or converged_flag:
            break

if __name__ == "__main__":
    # Define the topology of the network
    network_topology = {
        1: [2, 3],
        2: [1, 4],
        3: [1, 5],
        4: [2, 6],
        5: [3],
        6: [4]
    }

    # Create processes
    processes = {uid: Process(uid, neighbors) for uid, neighbors in network_topology.items()}

    # Run BFS spanning tree algorithm
    bfs_spanning_tree(1, processes)

    # Print the resulting BFS tree
    print("\nBFS Tree:")
    for uid, process in processes.items():
        print(f"Process {uid} - Parent: {process.parent}, Depth: {process.depth}")

