class Process:
    def __init__(self, uid, neighbors):
        self.uid = uid
        self.neighbors = neighbors
        self.dist = 0 if uid == 1 else float('inf')  # Initial distance from root node
        self.parent = None
        self.messages_received = 0
        self.converged = False  # Flag to indicate convergence

    def send_message(self):
        return self.dist, self.converged

    def receive_message(self, message, sender_uid):
        new_dist, converged = message
        if new_dist < self.dist:
            self.dist = new_dist
            self.parent = sender_uid
            self.messages_received += 1
            if self.converged != converged:
                self.converged = converged
                return True
        return False

def bellman_ford_shortest_paths(root_uid, processes):
    root_process = processes[root_uid]
    current_round = 0
    while True:
        current_round += 1
        messages_sent = 0
        converged_flag = True  # Assume convergence until proven otherwise
        for uid, process in processes.items():
            for neighbor_uid, weight in process.neighbors:  # Modified to include weights
                neighbor_process = processes[neighbor_uid]
                message = (process.dist + weight, process.converged)  # Include weight in the message
                messages_sent += 1
                received = neighbor_process.receive_message(message, uid)
                if received:
                    print(f"Round {current_round}: Process {neighbor_uid} updated its distance to {neighbor_process.dist} with parent {uid}")
                    converged_flag = False  # If any process updates its distance, convergence is not achieved
        if messages_sent == 0 or converged_flag:
            break

